    if(linkName === 'home'){
      return (
        <div>
          <Link href ={'./'}>
          <a>
            {props.children}
          </a>
       </Link>
        </div>
      )
    }

    if(linkName === 'contact'){
      console.log('hi')
      return
    }

    return (
      <div>
       <Link href ={'/' + linkName}>
        <a>
            {props.children}
        </a>
